-- ì´ë²¤íŠ¸ seesaw.UpdateMemberMissionIsSaving êµ¬ì¡° ë‚´ë³´ë‚´ê¸°
DELIMITER //
CREATE EVENT `UpdateMemberMissionIsSaving` ON SCHEDULE EVERY 1 DAY STARTS '2023-10-04 02:00:00' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
  # ì–´ì œì˜ ë‚ ì§œ ê³„ì‚°
  DECLARE yesterday DATE;
  SET yesterday = DATE_SUB(CURRENT_DATE, INTERVAL 1 DAY);

  # record í…Œì´ë¸”ì—ì„œ ì–´ì œ íšŒì°¨ê°€ ì¢…ë£Œëê³  ì„±ê³µí•œ ê²½ìš°ì— ëŒ€í•´ memberMissionIsSaving ì—…ë°ì´íŠ¸
UPDATE member_mission AS mm
    JOIN record AS r ON mm.member_email = r.member_email AND mm.mission_id = r.mission_id
    SET mm.member_mission_is_saving = TRUE
WHERE r.record_end_date = yesterday
  AND r.record_status = 1
  AND mm.member_mission_saving_money > 0;

END//
DELIMITER ;

